import React from "react";

const ListStudent = () => {
    return (
        <div>
            <h2>Listar estudante</h2>
            <table>
                <thead>
                    <th>ID</th>
                    <th>Nome</th>
                    <th>Curso</th>
                    <th>IRA</th>
                    <th colSpan="2"></th>
                </thead>
            </table>
        </div>
    )
}

export default ListStudent;
